import React from 'react'
import { FaHome } from "react-icons/fa";

import '../App.css' 
import Friends from './Friends';
import Groups from '../Middle-clone/Groups';


function Home() {
    return (
        <div className="middle-div">
          <div className="home"><FaHome style={{height:'25px',width:'25px'}}></FaHome> 
          <span >Home</span>
           </div>
          <Friends></Friends>
          <Groups></Groups>
        </div>
    )
}

export default Home
